svg.script:
var SpriteSheetAnimation = new function()
{
  window.addEventListener("load",init);
  var frameindex = 0;
  var numMoves = 20;
  var frames = Array(1,2,3,4,3,2,1,2,5,6,7,6,8,9,8,6,7,6,10,2);

  function init()
  {
    setTimeout(startAnimation,1000);
  }

  function startAnimation()
  {
    setInterval(DisplayNextFrame,125);
    document.documentElement.setAttribute("viewBox","0 0 225 255");
    document.getElementById("sprites").setAttribute("style","clip-path:url(#cp1);");
  }

  function DisplayNextFrame()
  {
    var frame = frames[frameindex]-1;
    document.documentElement.setAttribute("viewBox",(frame%5)*270+" "+Math.floor(frame/5)*300+" 225 255");
    //document.getElementById("cp1").setAttribute("viewBox",(frame%6)*270+" "+Math.floor(frame/5)*300+" 220 250");
    document.getElementById("cp").setAttribute("x",(frame%5)*270);
    document.getElementById("cp").setAttribute("y",Math.floor(frame/5)*300);
    frameindex++;
    if(frameindex==numMoves) frameindex=0;
  }
}();
